import React, { Component } from 'react';
import { Tab, Tabs } from '@blueprintjs/core';
import { TabContent, TabPane } from 'reactstrap';
import Sidebar from '../../components/Sidebar/Sidebar';

import MainDashboard from './components/MainDashboard';
import TestView2 from './components/TestComponent2';
import TestView3 from './components/TestComponent3';
import TestView4 from './components/TestComponent4';
import SidebarItem from '../../components/Sidebar/SidebarItem';

export default class Dashboards extends Component {
   state = {
      activeTabID: 1,
      selected: 'A'
   };
   handleTabChange = TabId => this.setState({ activeTabID: 1 });

   changeSelection(id) {
      this.setState({ selected: id });
   }

   render() {
      const { selected } = this.state;
      return (
         <div>
            <Sidebar>
               <SidebarItem
                  icon='dashboard'
                  selected={selected === 'A'}
                  onClick={() => this.changeSelection('A')}
               />
               <SidebarItem
                  icon='time'
                  selected={selected === 'B'}
                  onClick={() => this.changeSelection('B')}
               />
            </Sidebar>
            <TabContent activeTab={selected}>
               <TabPane tabId='A'>
                  <Tabs onchange={this.handleTabChange} large>
                     <Tab id='1' title='Overall' panel={<MainDashboard />} />
                     <Tab id='2' title='Total' panel={<TestView2 />} />
                     <Tab id='3' title='Timeline' panel={<TestView3 />} />
                     <Tab id='4' title='SLAs' panel={<TestView4 />} />
                  </Tabs>
               </TabPane>
               <TabPane tabId='B'>Something</TabPane>
            </TabContent>
         </div>
      );
   }
}
